import React from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

function PerformanceChart({ data }) {
    // Veriyi ReCharts için uygun formata dönüştür
    const chartData = {
        labels: ['Sıralı Algoritma', 'Temel Paralel', 'Geliştirilmiş Paralel', 'Block-Based'],
        datasets: [
            {
                label: 'Çalışma Süresi (sn)',
                data: [
                    data.sequential.time,
                    data.parallel.time,
                    data.improved.time,
                    data.blocked.time
                ],
                backgroundColor: 'rgba(54, 162, 235, 0.5)',
                borderColor: 'rgba(54, 162, 235, 1)',
                borderWidth: 1
            }
        ]
    };

    const speedupData = {
        labels: ['Sıralı Algoritma', 'Temel Paralel', 'Geliştirilmiş Paralel', 'Block-Based'],
        datasets: [
            {
                label: 'Hızlanma (Speedup)',
                data: [
                    data.sequential.speedup,
                    data.parallel.speedup,
                    data.improved.speedup,
                    data.blocked.speedup
                ],
                backgroundColor: 'rgba(75, 192, 192, 0.5)',
                borderColor: 'rgba(75, 192, 192, 1)',
                borderWidth: 1
            }
        ]
    };

    return (
        <div className="chart-wrapper">
            <h5 className="text-center mb-3">Çalışma Süresi Karşılaştırması</h5>
            <ResponsiveContainer width="100%" height={300}>
                <BarChart
                    data={[chartData[0]]}
                    margin={{
                        top: 5,
                        right: 30,
                        left: 20,
                        bottom: 5,
                    }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis />
                    <Tooltip formatter={(value) => value.toFixed(6)} />
                    <Legend />
                    <Bar dataKey="Sıralı Algoritma" fill="#6c757d" />
                    <Bar dataKey="Temel Paralel" fill="#0d6efd" />
                    <Bar dataKey="Geliştirilmiş Paralel" fill="#198754" />
                    <Bar dataKey="Strassen Algoritması" fill="#dc3545" />
                </BarChart>
            </ResponsiveContainer>

            <h5 className="text-center mb-3 mt-5">Hızlanma (Speedup) Karşılaştırması</h5>
            <ResponsiveContainer width="100%" height={300}>
                <BarChart
                    data={[speedupData[0]]}
                    margin={{
                        top: 5,
                        right: 30,
                        left: 20,
                        bottom: 5,
                    }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis />
                    <Tooltip formatter={(value) => value.toFixed(2)} />
                    <Legend />
                    <Bar dataKey="Sıralı Algoritma" fill="#6c757d" />
                    <Bar dataKey="Temel Paralel" fill="#0d6efd" />
                    <Bar dataKey="Geliştirilmiş Paralel" fill="#198754" />
                    <Bar dataKey="Strassen Algoritması" fill="#dc3545" />
                </BarChart>
            </ResponsiveContainer>
        </div>
    );
}

export default PerformanceChart;
